syntax = "proto2";

option cc_api_version = 2;

package third_party.gdal.autotest2.cpp.ogr.ogrsf_frmts.mitab;

message Mitab {
  optional bytes map = 1;
  optional bytes mif = 2;
  optional bytes mid = 3;
  optional bytes tab = 4;
  optional bytes ind = 5;
  optional bytes dat = 6;
  optional bytes id = 7;
}
